import React, { useState, useEffect } from "react";
import {NavLink } from 'react-router-dom';
import { Link } from 'react-scroll';
import "./Navigation.css";
import styled from "styled-components";

export default function Navigation(){
    
    const [isMenuShow, setIsMenuShow] = useState(false);

    const onBtnClick = () => {
    setIsMenuShow(false);
        };

    return(
        <HeaderContainer>
                <HeaderTitle to="HomeContainer" className="HeaderTitle" spy={true} smooth={true}>
                    Ag.
                </HeaderTitle>
            <HeaderBox>
            <div className= "HeaderMenu">
                <Link to="HomeContainer" className="NavBtn" spy={true} smooth={true}>
                    HOME
                </Link>
                
                <Link to="AboutContainer" className="NavBtn" spy={true} smooth={true}>
                    ABOUT
                </Link>

                <Link to="ProjectContainer" className="NavBtn" spy={true} smooth={true}>
                    PROJECTS
                </Link>

                <Link to="ProfileContainer" className="NavBtn" spy={true} smooth={true}>
                    PROFILE
                </Link>


                <Link to="ConnectContainer" className="NavBtn" spy={true} smooth={true}>
                    CONNECT
                </Link>
            </div>
        </HeaderBox>
        </HeaderContainer>
    )
}

const HeaderTitle = styled(Link)`
    margin-top: 3%;
    color: white;
    font-size: 40px;
    animation: rotation linear infinite 3s;
    text-decoration: none;
    padding-left: 7.5%;
    transition: 1s;
`;

const HeaderContainer = styled.div`
    display: flex;
    background-color: black;
    width: 100%;
    color: white;
    position: fixed;
    z-index: 999;
    opacity: 0.8;
`;

const HeaderBox = styled.div`
    margin-top: 4%;
`;
